"    <br>",
"     (D) Lift the handle of the LMA Fastrach as the endotracheal tube is about to pass into the larynx to improve the success rate of intubation. This is called the Vergese maneuver after Dr. Archie Brain's associate Dr. Chandy Vergese.",
