" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Key components of the health belief model",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Threat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perceived susceptility to an ill-health condition (or",
"acceptance of diagnosis)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perceived seriousness of condition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Outcome expectations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perceived benefits of specified action",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perceived barriers to taking that action",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Efficacy expectations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
